import React from 'react';
import { Link } from 'react-router-dom';
import './nav.css';
import cookingLogo from 's-valeria-boltneva-842571.jpg';

const Nav = () => {
  return (
    <nav>
      <div className="nav-cont">
        <div className="title">
          <img src={cookingLogo} alt="Cooking Logo" />
          <h1>Foodie</h1>
        </div>

        <div className="nav-items">
          <Link to="/" style={{ textDecoration: "none" }}><h3>Home</h3></Link>
          <Link to="/about" style={{ textDecoration: "none" }}><h3>About Us</h3></Link>
          <Link to="/menu" style={{ textDecoration: "none" }}><h3>Menu</h3></Link>
          <Link to="/contact" style={{ textDecoration: "none" }}><h3>Contact</h3></Link>
        </div>

        <div className="book-button">
          <button>Book A Table</button>
        </div>
      </div>
    </nav>
  );
};

export default Nav;
